function updateSellFees(uint256 _marketingFee, uint256 _liquidityFee) public {
    // Only the contract owner can call this function
    require(msg.sender == owner(), "Ownable: caller is not the owner");

    // Update individual fee values
    sellMarketingFee = _marketingFee;
    sellLiquidityFee = _liquidityFee;

    // Redundant check preserved from original bytecode
    require(
        _marketingFee <= _marketingFee + _liquidityFee,
        "Must keep fees at 90% or less"
    );

    // Update the cached total of all sell-side fees
    sellTotalFees = _marketingFee + _liquidityFee;

    // Enforce the maximum total fee cap (90%)
    require(
        _marketingFee + _liquidityFee <= 90,
        "Must keep fees at 90% or less"
    );
}

